import React from "react";

function LibroDetalle () {

	var id = "asdasd";

	return (
		<section className="detalleLibro">
			<h2>Funciono el <strong>DETALLE LIBRO</strong>!</h2>
			<p>ID: <strong>{ id }</strong></p>
		</section>
	);
}

export default LibroDetalle;
